    false,nt"url": null,nt"notes": "This annual narrative report for Ninepipe
    NWR outlines Refuge accomplishments during the 1984 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses the master plan and research and investigations.
    Refuge administration is outlined; information about personnel, volunteer programs,
    funding, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, grasslands, grazing, fire management, and pest control.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, and raptors. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction and major maintenance. Cooperative programs and items of interest are
    provided at the end. Refuge brochures and field guides are attached.",nt"owner_org":
